import React, { useState } from 'react';
import HomeOver from '../components/HomeOver';
import { Container, Button } from 'reactstrap';

const Home = (props) => {

    const [loading, setLoading] = useState(true);

    setTimeout( () => {
        setLoading(false);
    },3200);

    return (
        <div className="home col-md-12">
            { loading
                ?
                    <Container>
                        <HomeOver />
                    </Container>
                :
                    <Container>
                        <h2>¿Dónde te encuentras? te ayudaremos a encontrar los productos que necesitas</h2>
                        <Button color="danger">DESDE LA TIENDA</Button>                      
                        <Button color="danger">DESDE MI HOGAR</Button>
                    </Container>
            }
        </div>
    );
};

export default Home;
